import React from 'react';

const StudentList = ({ students }) => {
    return (
        <div>
            <ul>
                {students.length === 0 ? (
                    <li>No students available</li>
                ) : (
                    students.map((student) => (
                        <li key={student.id}>
                            {student.name} ({student.department}) - Semester {student.semester}
                        </li>
                    ))
                )}
            </ul>
        </div>
    );
};

export default StudentList;
